import React, { useState } from 'react';
import { styled } from '@mui/material/styles';
import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  CircularProgress,
  Alert,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Typography,
  Box,
} from '@mui/material';
import { useOptionChainData } from '../../features/optionChain/hooks/useOptionChainData';
import { OptionData } from '../../types/options';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  padding: theme.spacing(1),
  textAlign: 'center',
  '&.positive': {
    color: theme.palette.success.main,
    fontWeight: 500,
  },
  '&.negative': {
    color: theme.palette.error.main,
    fontWeight: 500,
  },
  '&.strike': {
    backgroundColor: theme.palette.grey[100],
    fontWeight: 600,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  '&:nth-of-type(odd)': {
    backgroundColor: theme.palette.action.hover,
  },
  '&:hover': {
    backgroundColor: theme.palette.action.selected,
  },
}));

interface Props {
  symbol: string;
}

export const OptionChainGrid: React.FC<Props> = ({ symbol }) => {
  const [selectedExpiry, setSelectedExpiry] = useState<string>('');
  const { data, loading, error } = useOptionChainData(symbol, selectedExpiry);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 3 }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return <Alert severity="error">{error.message}</Alert>;
  }

  if (!data) {
    return <Alert severity="info">No data available</Alert>;
  }

  const formatValue = (value: number) => value.toFixed(2);
  const getChangeClass = (change: number) => (change >= 0 ? 'positive' : 'negative');

  return (
    <Paper sx={{ width: '100%', overflow: 'hidden' }}>
      <Box sx={{ p: 2 }}>
        <FormControl sx={{ minWidth: 200 }}>
          <InputLabel>Expiry Date</InputLabel>
          <Select
            value={selectedExpiry}
            label="Expiry Date"
            onChange={(e) => setSelectedExpiry(e.target.value)}
          >
            {data.expiry_dates.map((date) => (
              <MenuItem key={date} value={date}>
                {date}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
      </Box>

      <TableContainer sx={{ maxHeight: 'calc(100vh - 300px)' }}>
        <Table stickyHeader size="small">
          <TableHead>
            <TableRow>
              <StyledTableCell>OI</StyledTableCell>
              <StyledTableCell>Change in OI</StyledTableCell>
              <StyledTableCell>Volume</StyledTableCell>
              <StyledTableCell>IV</StyledTableCell>
              <StyledTableCell>LTP</StyledTableCell>
              <StyledTableCell>Change</StyledTableCell>
              <StyledTableCell className="strike">Strike</StyledTableCell>
              <StyledTableCell>LTP</StyledTableCell>
              <StyledTableCell>Change</StyledTableCell>
              <StyledTableCell>IV</StyledTableCell>
              <StyledTableCell>Volume</StyledTableCell>
              <StyledTableCell>Change in OI</StyledTableCell>
              <StyledTableCell>OI</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.strikes.map((strike) => {
              const callKey = `${strike}_CE_${selectedExpiry}`;
              const putKey = `${strike}_PE_${selectedExpiry}`;
              const call = data.options[callKey];
              const put = data.options[putKey];

              return (
                <StyledTableRow key={strike}>
                  <StyledTableCell>{formatValue(call?.oi || 0)}</StyledTableCell>
                  <StyledTableCell className={getChangeClass(call?.change || 0)}>
                    {formatValue(call?.change || 0)}
                  </StyledTableCell>
                  <StyledTableCell>{call?.volume || 0}</StyledTableCell>
                  <StyledTableCell>{formatValue(call?.iv || 0)}%</StyledTableCell>
                  <StyledTableCell>{formatValue(call?.last_price || 0)}</StyledTableCell>
                  <StyledTableCell className={getChangeClass(call?.change || 0)}>
                    {formatValue(call?.change || 0)}%
                  </StyledTableCell>
                  <StyledTableCell className="strike">{strike}</StyledTableCell>
                  <StyledTableCell>{formatValue(put?.last_price || 0)}</StyledTableCell>
                  <StyledTableCell className={getChangeClass(put?.change || 0)}>
                    {formatValue(put?.change || 0)}%
                  </StyledTableCell>
                  <StyledTableCell>{formatValue(put?.iv || 0)}%</StyledTableCell>
                  <StyledTableCell>{put?.volume || 0}</StyledTableCell>
                  <StyledTableCell className={getChangeClass(put?.change || 0)}>
                    {formatValue(put?.change || 0)}
                  </StyledTableCell>
                  <StyledTableCell>{formatValue(put?.oi || 0)}</StyledTableCell>
                </StyledTableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
    </Paper>
  );
};
